  inverselatlng(array) {
    for (let j=0; j <array.length; j++) {
     for (let i=0; i < array[j].length; i++) {
        var x=array[j][i][0];
        array[j][i][0]=array[j][i][1];
        array[j][i][1]=x;
      };
    };
    return array;
  }


